public void readExternal( ObjectInput in ) throws
    IOException, ClassNotFoundException {
  length = in.readInt();
  offset = 0;
  if (length > 0) {
    bytes = new byte[length];
    in.read(bytes, 0, length);
  } else {
    bytes = null;
  }
}

